import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { DvCalculator, NameSplitter } from './screens';

const styles = {
  buttonGroup: {
    margin: "0 auto",
  }
}

ReactDOM.render(
  <React.StrictMode>
      <div className="header" />
      <div style={styles.buttonGroup}>
        <button>Calculadora de DV</button>
        <button>Split de nombres</button>
      </div>
    <DvCalculator />
  </React.StrictMode>,
  document.getElementById('root')
);
